import React from 'react';

import { ContentCard, NameCard } from '../OrderForm/style';

const OrderResultCard = ({ orderInfo }) => {
    return (
        <ContentCard>
            <div style={{
                display:'flex',
            }}>
                <NameCard style={{margin:'0 20px 0 0'}}>
                    {orderInfo.dinnerName}
                </NameCard>
                <NameCard style={{margin: '0 20px'}}>
                    {orderInfo.dinnerStyle}
                </NameCard>
                <NameCard style={{margin: '0 20px'}}>
                    {orderInfo.mealNum}인 식사
                </NameCard>
                <NameCard style={{margin: '0 0 0 20px'}}>
                    {orderInfo.resTime}
                </NameCard>
            </div>
        </ContentCard>
    );
};

export default OrderResultCard;
